// import React, { useState, useEffect} from 'react';
// Bootstrap
import { Table } from 'react-bootstrap';
import { Container } from "react-bootstrap";
import {Ingredient} from "../types/types";
import {addIngredient} from "../redux/actions/actions";
import {connect} from "react-redux";

const ProductsList = ({ingredients, addIngredient}) => {


    if(ingredients[0] !== undefined){
        return(
            <Container>
                <Table striped bordered hover>
                    <thead>
                        <tr>
                            <th>xd</th>
                            <th>Amount of xyz</th>
                            <th>Delete</th>
                        </tr>
                    </thead>
                    <tbody>
                        {ingredients.map((ingredient) => {
                            console.log(ingredient.payload.unit);
                            <tr key={ingredient.payload.id}>
                                <td>{ingredient.payload.id + 1}</td>
                                <td>{ingredient.payload.label}</td>
                                <td>{ingredient.payload.unit}</td>
                            </tr>
                        })}
                    </tbody>
                </Table>
            </Container>

        )
    }

    return(
        <a>Your ingredient list is empty!</a>
    )
}

export default connect(
    (state) => ({
        ingredients: state.ingredients.ingredientsList,
    }), {
        addIngredient: addIngredient
    }
)(ProductsList);
